  [],\n\t\"revision_timestamp\": \"2015-09-27T00:09:16.801167\",\n\t\"name\": \"united-states-coast-pilot-volume-1-through-9\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Coast Pilot is a series
  of 9 nautical books that cover a wide variety of information important to navigators
  of U.S. coastal and intercoastal waters, and the waters of the Great Lakes. Most
  of this information cannot be shown graphically on the standard nautical charts
  and is not readily available elsewhere. The subjects of the Coast Pilot include,
  but are not limited to, channel descriptions, anchorages, bridge and cable clearances,
  currents, tide and water levels, prominent features, pilotage, towage, weather,
  ice conditions, wharf descriptions, dangers, routes, traffic separation schemes,
  small-craft facilities and federal regulations applicable to navigations.\",\n\t\"license_title\":
