  \"underDevelopment\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\":
  \"[\"Use Constraints: The Coast Pilot supplements the navigational information shown
  on charts. Mariners and others are urged to report promptly to the National Ocean
  Service errors, omissions, or any conditions found to differ from or to be additional
  to those published in the Coast Pilot or shown on the charts in order that they
  may be fully investigated and proper corrections made.\", \"Access Constraints:
  The newest edition automatically cancels out any previous version of a book. Amendments
  to the Coast Pilot are availabel online at http://www.nauticalcharts.noaa.gov/nsd/cpdownload.htm,
  and through the National Geospatial-Intelligence Agency's Notices to Mariner. An
  up-to-date Coast Pilot, as defined by law, includes the book and all amendments
  cut and pasted into the appropriate sections.\"]\"\n\t},\n\t{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
